script: |
  super -f text -I q101.spq | sort > q101.out

inputs:
  - name: q101.spq
    data: |
      SELECT ALL + 21 - col0 AS col0 FROM tab2 (FORMAT parquet) WHERE NOT - col2 + + - col1 + + - col1 NOT BETWEEN - - 31 * col1 / col1 + - col0 + - 15 / + + col0 AND + col0;
  - name: tab2

outputs:
  - name: q101.out
    data: |
